import React from 'react';
import Pokemon from './Pokemon.jsx'
import data from 'my-pokedex/src/data.js';

class Pokedex extends React.Component {
  render() {
    return (
      data.map(pokemon => Pokemon(pokemon))
    )
  }
}

export default Pokedex;
